import VueRouter from 'vue-router'

const routes=[
    {
        path:'/',
        name:'login',
        component:()=>import('../components/Login')
    },
    {
        path: '/Index',
        name:'Index',
        component:()=>import('../components/Index'),
        children:[
            {
                path:'/Home',
                name:'home',
                meta:{
                  title:'扶뒬못'
                },
                component:()=>import('../components/Home')
            }
        ]
    }
]
const router = new VueRouter(
    {
        mode:"history",
        routes
    }
)

export default router;
